CREATE TABLE m_navi_action_login(
  id INTEGER NOT NULL,
  login_bonus_type INTEGER NOT NULL,
  login_bonus_id INTEGER,
  login_bonus_day INTEGER,
  member_m_id INTEGER NOT NULL,
  suit_m_id INTEGER,
  navi_action_id INTEGER NOT NULL,
  priority INTEGER NOT NULL,
  interval INTEGER NOT NULL,
  PRIMARY KEY (id),
  FOREIGN KEY (member_m_id) REFERENCES m_member(id),
  FOREIGN KEY (navi_action_id) REFERENCES m_navi_action(id)
);
